import {
  Form,
  FormGroup,
  Input,
  Label,
  Button,
  Container,
  Row,
  Col,
} from "reactstrap";
import { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { updateUserProfile } from "../Features/UserSlice";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { userValidationsSchema } from "../Validation/UserValidation";
import Location from "./Location";
import profile from "../Images/profile.png";
import loc from "../Images/loc.png";
import "../App.css"; // ✅ in case you style button / image

const Profile = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const { user, isLoading } = useSelector((state) => state.users);

  const [name, setName] = useState(user.name || "");
  const [pwd, setPwd] = useState(user.password || "");
  const [profilePic, setProfilePic] = useState(user.profilePic || "");

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(userValidationsSchema),
  });

  useEffect(() => {
    if (!user.email) {
      navigate("/login");
    }
  }, [user.email, navigate]);

  const onSubmit = (data) => {
    const updatedUser = {
      email: user.email,
      name: name,
      password: pwd,
    };
    dispatch(updateUserProfile(updatedUser));
    alert("Profile Updated Successfully!");
    navigate("/login"); // Force re-login after updating
  };

  const handleFileChange = (event) => {
    const uploadFile = event.target.files[0];
    if (uploadFile) {
      setProfilePic(uploadFile);
    } else {
      alert("No file selected!");
    }
  };

  return (
    <Container className="py-5">
      <Row className="align-items-start">
        {/* Profile Info */}
        <Col md={7} className="text-center">
          <img
            src={profile}
            alt="User"
            className="profileImage mb-4"
            style={{ width: "200px", height: "200px", borderRadius: "50%" }}
          />

          <Form onSubmit={handleSubmit(onSubmit)}>
            <FormGroup className="text-start">
              <Label>Upload New Profile Photo</Label>
              <Input type="file" onChange={handleFileChange} />
            </FormGroup>

            <FormGroup className="text-start">
              <Label for="name">Full Name</Label>
              <Input
                id="name"
                type="text"
                value={name}
                {...register("name")}
                onChange={(e) => setName(e.target.value)}
                placeholder="Enter your name"
              />
              {errors.name && <p className="text-danger">{errors.name.message}</p>}
            </FormGroup>

            <FormGroup className="text-start">
              <Label for="password">Password</Label>
              <Input
                id="password"
                type="password"
                value={pwd}
                {...register("password")}
                onChange={(e) => setPwd(e.target.value)}
                placeholder="Enter your password"
              />
              {errors.password && <p className="text-danger">{errors.password.message}</p>}
            </FormGroup>

            <Button color="primary" type="submit" disabled={isLoading} block>
              {isLoading ? "Updating..." : "Update Profile"}
            </Button>
          </Form>
        </Col>

        {/* Location Info */}
        <Col md={5} className="text-center">
          <img
            src={loc}
            alt="Location Icon"
            className="profileImage mb-4"
            style={{ width: "150px", height: "150px" }}
          />
          <h3>Your Location</h3>
          <Location />
        </Col>
      </Row>
    </Container>
  );
};

export default Profile;
